import React from 'react'

import "./create-project.styles.css"

const CreateProject = () => {

    const handleClick = e => {
        e.preventDefault()
        console.log(e.target)
    }

    return (
        <div className="button-container">
            <button
                onClick={handleClick}
            >
            CREATE NEW PROJECT
            </button>
        </div>
    )
}

export default CreateProject
